import numpy as np
def mlr_predict(x, w):
    """
    Uses the weights to estimate the target (y_hat) for each row of x.

    :param x: List of lists representing x matrix, each row is an x^(i) vector.
    :param w: The weights. 
    :return: A numpy array of the estimated values. 

    """
    result = np.empty(len(x))
    for index in range(len(x)):
        result.itemset(index, np.dot(x[index], w))
    return result
def mlr_cost(x, y, w):
    """
    Return half of the mean squared error between the estimated and truevalues of y.
    
    :param x: List of lists representing X matrix, each row is an x^(i) vector.
    :param y: List of correct y-values.
    :param w: List of weights.
    :return: The value of the cost function.
    
    """
    result = 0
    x_copy = np.copy(x)
    w_copy = np.copy(w)
    y_copy = np.copy(y)
    denom = 2 * len(x_copy)
    for index in range(len(x)):
      
        w_x_product = np.dot(np.transpose(w_copy), x_copy[index])
        y_subtract = np.subtract(y_copy[index], w_x_product)
        result += np.power(y_subtract, 2)
    result = np.divide(result, denom)
    result = np.round(result, 6)
    return result
def mlr_gradient(x, y, w):
    """
    Return the gradient of the multiple least squares cost function.
    
    :param x: List of lists representing X matrix, each row is an x^(i) vector.
    :param y: List of correct y-values.
    :param w: List of weights.
    :return: The gradient of the multiple least squares cost function asa list (dJ/dw_0, dJ/dw_1, dJ/dw_2, ...)
    
    """
    result = np.zeros(len(x[0]))
    denom = 1 / len(x)
    for index in range(len(x)):
        w_x_dot_product = np.dot(np.transpose(w), x[index])
        y_subtraction = y[index] - w_x_dot_product
        minus_x_product = np.multiply(y_subtraction, (np.multiply(x[index], -1)))
        result = np.add(result, minus_x_product)
    result = np.dot(denom, result)
    result = np.round(result, 6)
    return result

